import React, { useState, useContext } from 'react'
import axios from "axios";
import AuthContext from "../contexts/AuthContext.jsx";
import {ReactSearchAutocomplete} from "react-search-autocomplete";
import FancyBar from "./FancyBar";

const items = [
  {
    id: 0,
    name: "Cobol",
  },
  {
    id: 1,
    name: "JavaScript",
  },
  {
    id: 2,
    name: "Basic",
  },
  {
    id: 3,
    name: "PHP",
  },
  {
    id: 4,
    name: "Java",
  },
];


const handleOnSearch = (string, results) => {
  console.log(string, results);
};

const handleOnHover = (result) => {
  console.log(result);
};

const handleOnSelect = (item) => {
  console.log(item);
};

const handleOnFocus = () => {
  console.log("Focused");
};

const handleOnClear = () => {
  console.log("Cleared");
};

const formatResult = (item) => {
  console.log(item);
  return (
    <div className="result-wrapper">
      <span className="result-span">id: {item.id}</span>
      <span className="result-span">name: {item.name}</span>
    </div>
  );
};

const Dashboard = () => {
    const { auth } = useContext(AuthContext);
    const [result, setResult] = useState("");
    const testQuery = () => {
        axios
            .get("http://localhost:5000/resolve/a/www.unipr.it")
            .then((res) => {
                setResult(res.data[0] + " - " + res.data[1]);
            });
    };

    return (
        <>
            <FancyBar/>
            <div style={{width:"100%", height: 'auto',position: 'relative '}}>
                <div style={{ width: '400px', verticalAlign: "middle", margin: 'auto'}}>
                  <ReactSearchAutocomplete
                    items={items}
                    onSearch={handleOnSearch}
                    onHover={handleOnHover}
                    onSelect={handleOnSelect}
                    onFocus={handleOnFocus}
                    onClear={handleOnClear}
                    styling={{


                    }}
                    formatResult={formatResult}
                    autoFocus
                  />
              </div>
            </div>
            <p>{result}</p>
        </>
    );
  }

export default Dashboard;
